script: |
  super -f text -I q601.spq | sort > q601.out

inputs:
  - name: q601.spq
    data: |
      SELECT col1 - - col2 - - col1 FROM tab1 (FORMAT parquet) WHERE col0 / - CAST ( NULL AS REAL ) / + 5 + - + col0 * - + col0 * + + 14 IS NOT NULL AND ( NULL ) < + - col0;
  - name: tab1

outputs:
  - name: q601.out
    data: |
